import React from 'react';
import { useHistory } from 'react-router-dom';

import '../App.css';


function Home() {
    const history = useHistory();
    const boggleOpen = () => {
      history.push('/components');
    };  
  return (
    <ome>
    <div>
      <h1> Boggggle </h1>
      <button onCLick = {boggleOpen}>
          start
      </button>
    </div>
    </ome>
  );
}

export default Home;
